import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './navigation.css';
import Navigation1 from './Navigation1'


class Navigation extends Component {

    constructor(props) {
        super(props);
        this.state ={
            plant : '',
        }
        this.onPlantChange = this.onPlantChange.bind(this);
    }


    render() {
        return (
            <div id="wrapper">
                <div className="warp">
                    <Navigation1 name={this.state.plant}/>
                </div>
                <div id="sidebar-wrapper">
                    <ul id="sidebar-nav">
                        <li className="hell"><a href="#">QR App</a></li>
                    </ul>
                    <ul id="sidebar-nav1" className="hello1">
                        <li className="hell">
                            <div className='hello123'>
                            <select onChange={ this.onPlantChange } className="custom-select">
                                <option value='Select the Plant' selected disabled>Select the Plant</option>
                                <option name='kothagadi' value='Kothagadi'>Kothagadi</option>
                                <option name='orai' value='Orai'>Orai</option>
                                <option name='parigi' value='Parigi'>Parigi</option>
                                <option name='peerampalle' value='Peerampalle'>Peerampalle</option>
                                <option name='rohini' value='Rohini'>Rohini</option>
                            </select>
                            </div>
                        </li>
                        <li><a href='http://localhost:5000/plantstats'>PlantStats</a></li>
                        <li><a href="http://localhost:5000/zonestats">Zone Stats</a></li>
                        <li><a href="http://localhost:5000/rowenquiry">Row Stats</a></li>
                    </ul>
                    <ul id="sidebar-nav2" className="hello2">
                        <li className="hell"><a href="#">Logged In as</a></li>
                        <li>{this.props.name}</li>
                        <li><a href="http://localhost:5000/signin">Log Out</a></li>
                    </ul>
                </div>
            </div>
        );
    }

    onPlantChange(e) {
        this.setState({
            plant: e.target.value,
        })
    }
}

export default Navigation;


